description:
A Map by Nutini

&amp;lt;b&amp;gt;We bet that Paolo Nutini doesn’t have friends in 30 countries!

Everyone in the UK knows Scottish crooner Paolo Nutini.  Paolo has STORMED the United States in recent months with a hugely successful tour, top-selling album and the hit single “New Shoes.”  But what about everywhere else?  There are 193 countries on planet earth and we bet that Paolo can’t get a shoutout from 30 of them.  Click on the map below to register and then follow the link to Paolo’s Platial map page.  Give Paolo a shoutout on his map from your home country and upload a picture if you like.  IMPORTANT:  Be sure to include a link to your myspace page or another social network to confirm that you live where you say you do.  No cheating!  Five winners will be selected at random to receive a copy of his new album “These Streets.”  You can also bet on how many countries will be represented.  Good luck!&amp;lt;/b&amp;gt;
